import React, { Component } from 'react';
import { Route, Routes } from "react-router-dom";

// import all the pages Here
import ticket_page from './components/ticket_page';

function App() {
  return (
	  <div>
				<Routes>
					<Route exact path="/tickets"  element={<ticket_page/>} />	
				</Routes>

		</div>
  );
}

export default App;
